import "./ExpensesItem.css";
import Date from './Date';
function ExpensesItem(props){
    return (
    <div className="expense-item">
        <div>
            <p>{props.title}</p>
        </div>&nbsp;&nbsp;
        <p>
            <Date/>
        </p>
        <p className="expense-item__price">$ {props.amount}</p>
    </div>

    );
}

export default ExpensesItem;
